import styled from "styled-components/native"

export const FirstView1 = styled.View`
flex-direction: row;
align-items: center;

display: flex;
`;

export const BigText1 = styled.Text`
font-family: 'Roboto';
font-style: normal;
font-weight: 300;
font-size: 24px;
line-height: 28px;
text-align: center;
color: #C3AD60;
`;

export const SecondView1 = styled.View`
display: flex;
margin-top: 231px;
align-items: center;
justify-content: center;
`;

export const PasteText = styled.Text`
font-family: 'Roboto';
font-style: normal;
font-weight: 300;
font-size: 18px;
line-height: 21px;
text-align: center;
letter-spacing: -0.333333px;
color: #000000;
`;
